import React, { useEffect } from 'react';
import axios from 'axios';

import { token1 } from '../token';

const city = 'Paphos';

const url = `https://api.openweathermap.org/data/2.5/weather?q=${city}&appid=${token1}`

export default function OpenWeatherScraper() {
    const [weather, setWeather] = React.useState([]);

    useEffect(() => {
        axios.get(url)
            .then(response => {
                const weather_response = response.data;
                setWeather({ weather_response });
            })
            .catch(error => { console.log(error) })
    }, []);

    return (
        <h1>{weather.name}</h1>
    )
}
